import { Box, Container } from '@mui/material'
import Router from 'next/router'
import { useEffect } from 'react'
import Head from 'next/head'



export default function ThankYouPopup(props) {
  const { setLayout } = props


  const handleClose = () => {
    setLayout(items => ({ ...items, thankYouPopup: false }))
    document.querySelector('footer').style.display = 'block'
  }


  useEffect(() => {
    document.querySelector('footer').style.display = 'none'
    setTimeout(() => handleClose(), 10000)
    window.scrollTo({ top: 0, behavior: 'smooth' })
    Router.events.on('routeChangeComplete', handleClose)
    return () => {
      Router.events.off('routeChangeComplete', handleClose)
    }
  }, [])


  return <>
    <Head>
      <title>Thank You | Synsoft Global</title>
    </Head>

    <Box component='section' sx={style.root}>
      <Container sx={style.container}>
        <Box sx={style.box}>
          <svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1350 650">
            <defs>
              <image width="1350" height="650" id="img1" href="data:image/png;base64," />
              <image width="61" height="30" id="img2" href="data:image/png;base64," />
            </defs>
            <use id="Background" href="#img1" x="0" y="0" />
            <path id="Shape 1" className="s0" style={{ fill: '#03989e', cursor: 'pointer' }} onClick={handleClose} d="m688.3 483c0-18.2 14.7-33 33-33h135.4c18.3 0 33 14.8 33 33 0 18.2-14.7 33-33 33h-135.4c-18.3 0-33-14.8-33-33z" />
            <use id="Back" href="#img2" x="759" y="468" style={{ cursor: 'pointer' }} onClick={handleClose} />
          </svg>
        </Box>
      </Container>
    </Box>
  </>
}





const style = {
  root: {
    'svg': { width: 1 },
  },
  container: { p: '0 !important', overflow: 'hidden' },
  box: { width: { xs: '140%', sm: '100%' }, marginLeft: { xs: '-10%', sm: '0' } }
}